import React from "react";
import { NavbarWrap } from "../../styles/components/Dashboard/NavbarStyle";
import {
  AiOutlineMenu,
  AiFillHome,
  AiTwotoneFire,
  AiTwotoneSetting,
} from "react-icons/ai";
import { MdLibraryBooks } from "react-icons/md";

export default function Navbar() {
  return (
    <NavbarWrap>
      <AiOutlineMenu className="navIcon" />
      <AiFillHome className="homeIcon" />
      <AiTwotoneFire className="trendIcon" />
      <MdLibraryBooks className="libraryIcon" />
      <AiTwotoneSetting className="setting" />
    </NavbarWrap>
  );
}
